DROP TABLE IF EXISTS vehicle_position_tmp;
CREATE TABLE vehicle_position_tmp (
    lat STRING,
    lon STRING,
    time STRING,
    lines STRING,
    brigade STRING,
    load_timestamp STRING
) ROW FORMAT DELIMITED FIELDS TERMINATED BY '|';
LOAD DATA INPATH '/transit_delays/tmp/vehicle_position/${filename}' OVERWRITE INTO TABLE vehicle_position_tmp;
INSERT INTO TABLE bronze.vehicle_position SELECT lat, lon, time, lines, brigade, load_timestamp FROM vehicle_position_tmp;
DROP TABLE IF EXISTS vehicle_position_tmp;

